description.p:
According to the present invention, the method of making an mesenchymal stem cell (MSC) secretome comprising:
i. culturing mesenchymal stem cells (MSCs) in a first culture media;
ii. removing the first culture media from step (i) from the MSCs;
iii. washing the MSCs in step (ii);
iv. adding a second culture media and culturing for about 1-5 days;
v. harvesting the second culture media from step (iv) as conditioned media; and
vi. processing the conditioned media in step (v) into the MSC secretome composition as described herein.
